import React, { Component } from 'react'

export default class SingbieBox extends Component {
  render() {
    return (
      <div>
        <div className="single-box">
          <div><span></span><a onClick={event => event.preventDefault()} href='/#'>允许退出</a></div>
          <div><span></span><a onClick={event => event.preventDefault()} href='/#'>通知班级管理员审核后退出</a></div>
          <div><span></span><a onClick={event => event.preventDefault()} href='/#'>禁止退出</a></div>
        </div>
      </div>
    )
  }
}
